import React, { Component } from "react"; //imrc
class Counter extends Component {
  //cc
  state = {
    tags: ["tag1", "tag2", "tag3"],
  };

  render() {
    return (
      <div>
        <ul>
          {this.state.tags.length === 0 ? (
            this.state.tags.map((tag) => <li key={tag}>{tag}</li>)
          ) : (
            <p>there is no tag</p>
          )}
        </ul>
      </div>
    );
  }
}

export default Counter;
